// 792. Number of Matching Subsequences

// Solution # 1 - maybe a little hacky but decent performance
// Runtime: 570 ms, faster than 22.22% of JavaScript online submissions for Number of Matching Subsequences.
// Memory Usage: 49.4 MB, less than 64.61% of JavaScript online submissions for Number of Matching Subsequences.

var isSubsequence = function(s, t) {
    if (s.length === 0){
        return true
    }
    
    let sIndex = 0;
    for (letter of t){
        // console.log(letter)
        if (letter === s[sIndex]){
            sIndex++
            if (sIndex === s.length){
                return true
            }
        } 
    }
    return false
};

var numMatchingSubseq = function(s, words) {
    let t = s;
    let totalMatches = 0;
    let matchedWords = [];
    let unmatchedWords = [];

    for (let word of words){
        if (unmatchedWords.includes(word)){
            continue
        }
        if (matchedWords.includes(word)){
            totalMatches++
            continue
        }
        if (isSubsequence(s = word, t = t) === true){
            totalMatches++
            matchedWords.push(word)            
        } else {
            unmatchedWords.push(word)
        }
        
    }
    return totalMatches
};

